import React, { useState, useEffect } from "react";
import Axios from "axios";

function Note(props) {
  useEffect(() => {
    Axios.get("http://localhost:5000/api/LoadNotes")
      .then((response) => console.log(response))
      .catch((e) => console.log(e));
  }, []);
  return (
    <div className="note">
      <h1>{props.title}</h1>
      <p>{props.content}</p>
    </div>
  );
}

export default Note;
